import React, { useState } from 'react';
import { Cart } from 'react-bootstrap-icons';
import "./Style.css"

function StockOrderInterface() {
  const [items, setItems] = useState([
     { id: 1, name: 'Pant', quantity: 6, price: 10, image: 'data:image/jpeg;base64,' },
    { id: 2, name: 'Shirt', quantity: 5, price: 15, image: 'data:image/jpeg;base64,' },
    { id: 3, name: 'Trouser', quantity: 0, price: 10, image: 'data:image/jpeg;base64,' },
    { id: 4, name: 'Shoes', quantity: 4, price: 20, image: 'data:image/jpeg;base64,' },
    { id: 5, name: 'Belt', quantity: 3, price: 3, image: 'data:image/jpeg;base64,' },
  
  ]);
  const audio = new Audio("/audio.m4a")

  const [cartItemsCount, setCartItemsCount] = useState(0);

  const addToCart = (itemId) => {
    setItems(prevItems => {
      const updatedItems = prevItems.map(item => {
        if (item.id === itemId && item.quantity > 0) {
          setCartItemsCount(prevCount => prevCount + 1);
          return { ...item, quantity: item.quantity - 1 };
        }
        return item;
      });
      console.log(`Item ${itemId} added to cart`);
      return updatedItems;
    });
    audio.play();
  };

  return (
    <div>
      <h1>Cart Items</h1>
      <div className="cart">
        {items.map(item => (
          <div key={item.id} className="item">
            <img src={item.image} alt={item.name} />
            <div className="details">
              <h3>{item.name}</h3>
              <p>Price: ${item.price}</p>
              <p>Quantity: {item.quantity}</p>
              <button onClick={() => addToCart(item.id)} disabled={item.quantity === 0}>Add to Cart</button>
              {item.quantity === 0 && <p className="out-of-stock">Out of Stock</p>}
            </div>
          </div>
        ))}
      </div>
      <div className="cart-icon">
      <Cart/>
  <span className="cart-count">{cartItemsCount}</span>
</div>
    </div>
  );
}

export default StockOrderInterface;
